import {Button, Grid, Typography} from "@mui/material";
import React from "react";

type AuthRequiredPropsType = {
    authFor: 'Bonus' | 'Vaxine',
    authFunction: ()=>void
}
const AuthRequiredComponent = (props: AuthRequiredPropsType) => {
    const authFor= props.authFor
    const authFunction= props.authFunction
    return (
        <><Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
            <Typography variant="h6" align="center"> Autorizzazione necessaria per accedere ai tuoi 
                {authFor}, vuoi autorizzare ora?</Typography>
        </Grid><Grid item xs={12} display="flex" justifyContent='center' alignItems="right">
            <Button style={{
                position: 'fixed',
                bottom: 20,
                borderRadius: 35,
                backgroundColor: "#92d36e",
                padding: "10px 20px",
                fontSize: "18px"
            }}
                    variant="contained"
                    onClick={() => {
                        authFunction()
                    }}>
                Autorizza
            </Button>
        </Grid></>
    );
}

export default AuthRequiredComponent;
